window.bookSummaryJSON = "<p>I'm one of four Willow daughters. He's the first-born son of the Scafoni family. And we have history.</p> <p>For generations, the Scafoni family have demanded a sacrifice of us. A virgin daughter to atone for sins so old that we don't even remember what they are anymore. </p> <p>But when you have as much money as they do, you don't play by the rules. You make them.</p> <p>And Sebastian Scafoni makes all the rules.</p> <p>The moment I saw him, I knew he would choose me. Even though the mark on my sheath declared me unclean. Even though my beautiful sisters stood beside me, offered to him, he still chose me.</p> <p>He made me his. And then he set out to break me.</p> <p>\"Intensely dark, twisted, and perversely hot! If you loved Pepper Winters's<i> Indebted</i>, you will love <i>Taken</i>.\" (Anna Zaires, <i>The New York Times </i>best-selling author)</p>"; 
